    position: absolute;
    display: flex;
    width: 100%;
    flex-direction: column;
    height: 78.7px;
    padding-bottom: 10px;
    justify-content: flex-end;
    z-index:99;
    background: #000;


    margin-top: -80px;
    justify-content: center;
    align-items: center;
    font-size: 1rem;
    position: sticky;
    top: 0;
    z-index: 10;

@media screen and (max-width: 960px){
    transition: 0.8s all ease;
}

